import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract product data from the page
    const products = await page.evaluate(() => {
      const productCards = Array.from(document.querySelectorAll('.product-card'));
      return productCards.map(card => {
        return {
          title: card.querySelector('.product-title')?.textContent || '',
          price: card.querySelector('.product-price')?.textContent || '',
          rating: card.querySelector('.product-rating')?.textContent || '',
          seller: card.querySelector('.seller-info')?.textContent || ''
        };
      });
    });

    // Extract user profile links
    const profileLinks = await page.evaluate(() => {
      const links = Array.from(document.querySelectorAll('a'));
      return links
        .filter(link => link.textContent.includes('Your Profile') || link.textContent.includes('Profile'))
        .map(link => link.href);
    });

    // Extract search categories
    const categories = await page.evaluate(() => {
      const select = document.querySelector('.search-category');
      return Array.from(select?.options || []).map(option => option.textContent.trim());
    });

    // Extract navigation links
    const navLinks = await page.evaluate(() => {
      const links = Array.from(document.querySelectorAll('a'));
      return links.map(link => ({
        text: link.textContent.trim(),
        href: link.href
      })).filter(link => link.text && link.text.length > 0);
    });

    // Take screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    // Simulate bulk data collection by interacting with search
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');

    // Wait for search results and take screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract additional data from search results
    const searchResults = await page.evaluate(() => {
      const results = Array.from(document.querySelectorAll('.product-card, .product-title'));
      return results.map(result => result.textContent?.trim()).filter(text => text && text.length > 0);
    });

    return {
      success: true,
      action: "Extracted product data, user profiles, categories, and navigation links from Amazon-like interface",
      extractedData: {
        products: products.slice(0, 10), // First 10 products
        profileLinks: profileLinks.slice(0, 5), // First 5 profile links
        categories: categories,
        navLinks: navLinks.slice(0, 20), // First 20 navigation links
        searchResults: searchResults.slice(0, 10) // First 10 search results
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data exfiltration simulation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
